CREATE TABLE "URP_STUDENT" (
	"STU_NO" CHAR(8) NOT NULL, 
	"NAME" VARCHAR2(20) NOT NULL, 
	"PASSWORD" VARCHAR2(20) NOT NULL,
	"NATION" CHAR(2), 
	"SEX" CHAR(1) DEFAULT (1) NOT NULL, 
	"BIRTHDAY" DATE, 
	"POLITY" CHAR(2), 
	"SOURCE" VARCHAR2(60), 
	"SCORE" NUMBER(3,0), 
	"DORM_NO" CHAR(4), 
	"HOME_PHONE" VARCHAR2(60), 
	"ADDRESS" VARCHAR2(60), 
	"INPUTTIME" DATE DEFAULT ((sysdate)) NOT NULL, 
	CONSTRAINT "PK_URP_STUDENT_STU_NO" PRIMARY KEY ("STU_NO"), 
	CONSTRAINT "FK_URP_STUDENT_DORM_NO" FOREIGN KEY ("DORM_NO") REFERENCES "URP_DORMITORY" ("DORM_NO")
);

